export default class APIService {
    // Insert an article
    static recycle(body) {
        return fetch(`http://localhost:5000/recycle`, {
                'method': 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(body)
            })
            .then(response => response)
            .catch(error => console.log(error))
    }
}
